import 'bootstrap/dist/css/bootstrap.min.css';
import React,{useEffect} from 'react';
import NavbarComp from '../components/Navbar';
import Footer from '../components/Footer';

function App() {
  return (
    <div className="App">
      <NavbarComp/>
      <Footer/>
    </div>
  );
}

export default App;
